import './Home.css';
import { Container, Row, Col } from 'react-bootstrap';
import { useHistory } from "react-router-dom";

function Home() {
    let history = useHistory();

    const handleRoute = () =>{ 
        history.push("/contact");
      }

    return (
        <div>
            <Container>
                <Row>
                    <Col>
                        <Row className="myName">Iâ€™m Karan Ghai</Row>
                        <Row className="typewriter">Software Developer</Row>
                        <Row>
                            <Col>
                                <button className="btnHire" onClick={handleRoute}>Hire Me</button>
                            </Col>
                            <Col>
                                <a className="btnDownload fa fa-download" href={require("../component/MyResume.pdf")} download="developerResume">Download CV</a>
                            </Col>
                            <Col>
                            </Col>
                        </Row>
                    </Col>
                    <Col><img className="zoom" src="/me.png" alt="profile_pic" /></Col>
                </Row>
            </Container>
        </div>
    );
}

export default Home;
